create table "DimensionVectors"
(
    "SystemName"        varchar not null
        constraint dimensionvectors_pk
            primary key
        constraint "SystemName"
            references "Units"
            on update cascade on delete cascade,
    "AmountOfSubstance" smallint,
    "ElectricCurrent"   smallint,
    "Length"            smallint,
    "LuminousIntensity" smallint,
    "Mass"              smallint,
    "Temperature"       smallint,
    "Time"              smallint,
    "Dimensionless"     smallint
);

alter table "DimensionVectors"
    owner to ipnajzyj;

